import React from 'react';

import './Navbar.css';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <div className='cv__navbar'>
    <div className='cv__navbar-heading'>
      <div className='cv__navbar-heading_square'></div>
      <Link to='/'><h3>Alok <Awasthi></Awasthi></h3></Link>
    </div>
  </div>
);

export default Navbar;
